import configConstants from '@config/constants'

const {
  API: { baseURL }
} = configConstants

const filter = {}

const params = Object.entries(filter)
  .map((arr) => `${arr[0]}=${arr[1]}`)
  .toString()
  .replaceAll(',', '&')

const URL = `${baseURL}/${'route'}${Object.keys(params).length > 0 ? '?' : ''}${params}`

const buuks = (route: string, params?: Record<string, string>) =>
  fetch(`${baseURL}/${route}${Object.keys(params || {}).length > 0 ? '?' : ''}${filter}`)

console.log('buukss', URL)

export default buuks
